// App.js
import React from 'react';
import Header from './components/Header';
import './components/styles.css';

const App = () => {
  return (
    <div className="app">
      <Header />
      <main>
        <h1>Narae's Portfolio</h1>
        <p>This is a placeholder content for your website.</p>
      </main>
    </div>
  );
};

export default App;
